import React from "react";

export default function Contact() {
  return (
    <section style={{ textAlign: "center" }}>
      <h2 style={{ fontSize: "1.75rem", fontWeight: 700 }}>Contact</h2>
      <p style={{ marginTop: 8 }}>Feel free to reach out: arcos@example.com</p>
    </section>
  );
}
